import { Fragment } from "react";
import React from "react";
import Navbar from "./Navbar";
function Cart() {
  return (
    <Fragment>
      <header>
        <Navbar></Navbar>
      </header>
      <section padding100px>
        <h1 class="heading">
          {" "}
          <span> My </span> Cart{" "}
        </h1>
      </section>
    </Fragment>
  );
}

export default Cart;
